import React from 'react';

export default class Homepage extends React.Component{
    render(){
    return(
        <div>
            <img style={decor.mainpic} src='https://res.cloudinary.com/dyuu7x24r/image/upload/v1549900826/BlanchetteProject/header.webp' alt='mainpicture'/>
            <div style={decor.grid}>
                <div><img style={decor.mainpic} src='https://res.cloudinary.com/dyuu7x24r/image/upload/v1549903031/BlanchetteProject/hat.jpg' alt='hat'/></div>
                <div><img style={decor.mainpic} src='https://res.cloudinary.com/dyuu7x24r/image/upload/v1549902744/BlanchetteProject/bag.jpg' alt='hat'/></div>
                <div><img style={decor.mainpic} src='https://res.cloudinary.com/dyuu7x24r/image/upload/v1549902735/BlanchetteProject/belt.jpg' alt='hat'/></div>
            </div>
            <div style={decor.column}>
                <div><img style={decor.pic} src='https://res.cloudinary.com/dyuu7x24r/image/upload/v1549911799/BlanchetteProject/chanel2.webp' alt='hat'/></div>
                <div><img style={decor.pic} src='https://res.cloudinary.com/dyuu7x24r/image/upload/v1549912311/BlanchetteProject/Screen_Shot_2019-02-11_at_20.11.18.png' alt='hat'/></div>
            </div>
        </div>
    )
}
}

const decor={
    mainpic:{
        width:'100%',
    },
    grid:{
        width: '95%',
        margin: 'auto',
        display: 'grid',
        gridTemplateColumns: '1fr 1fr 1fr',
        gridGap: '2em',
        marginTop: '2em'
    },
    pic:{
        height: '100%',
        width:'100%'
    },
    column:{
        width: '95%',
        margin: 'auto',
        display: 'grid',
        gridTemplateColumns: '2.1fr 1fr',
        gridGap: '2em',
        marginTop: '2em'
    }
}
